test_sanity();disp("All Tests Passed");%plot_temp_dependence();%plot_sal_dependence();%plot_chl_dependence();%plot_I_dependence();function plot_temp_dependence()    particle = Particle(.001, 940, 1e5, 0, 0, 5);    T = linspace(-2, 37, 100); % Celsius    S = 35;  % g kg^-1    I = 200; % mol quanta m^-2 s^-1    chl = 1; % mg m^-3    algae = zeros(100, 1);    for i=1:100        algae(i) = get_algae_collisions(particle, S, T(i), chl, I);    end        plot(T, algae);    xlabel("T (Celsius)");    ylabel("Collided algae cells per second");endfunction plot_sal_dependence()    particle = Particle(.001, 940, 1e5, 0, 0, 5);    T = 20; % Celsius    S = linspace(30, 40, 100);  % g kg^-1    I = 200; % mol quanta m^-2 s^-1    chl = 1; % mg m^-3    algae = zeros(100, 1);    for i=1:100        algae(i) = get_algae_collisions(particle, S(i), T, chl, I);    end        plot(S, algae);    xlabel("S (g/kg)");    ylabel("Collided algae cells per second");endfunction plot_chl_dependence()    particle = Particle(.001, 940, 1e5, 0, 0, 5);    T = 20; % Celsius    S = 35;  % g kg^-1    I = 200; % mol quanta m^-2 s^-1    chl = linspace(0, 60, 100); % mg m^-3    algae = zeros(100, 1);    for i=1:100        algae(i) = get_algae_collisions(particle, S, T, chl(i), I);    end        plot(chl, algae);    xlabel("S (g/kg)");    ylabel("Collided algae cells per second");endfunction plot_I_dependence()    particle = Particle(.001, 940, 1e5, 0, 0, 5);    T = 20; % Celsius    S = 35;  % g kg^-1    I = linspace(0, 400, 100); % mol quanta m^-2 s^-1    chl = 1; % mg m^-3    algae = zeros(100, 1);    for i=1:100        algae(i) = get_algae_collisions(particle, S, T, chl, I(i));    end        plot(I, algae);    xlabel("S (g/kg)");    ylabel("Collided algae cells per second");endfunction test_sanity ()    % not much to test, logic of get_algae_collisions is very simple.    particle = Particle(.001, 940, 1e5, 0, 0, 5);    T = 20;  % Celsius    S = 35;  % g kg^-1    I = 200; % mol quanta m^-2 s^-1    chl = 1; % mg m^-3    A = get_encounter_kernel_rate(particle, S, T) * convert_chl_to_algae(chl, T, I);    B = get_algae_collisions(particle, S, T, chl, I);    assert_equal(A, B);end